script: |
  super -f text -I q7701.spq | sort > q7701.out

inputs:
  - name: q7701.spq
    data: |
      SELECT col2 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT ( - col1 * - col0 ) BETWEEN + 19 AND - 18 + - - col2;
  - name: tab2

outputs:
  - name: q7701.out
    data: |
      23
      40
      58
